import React, { Component } from 'react';

import Button from 'react-bootstrap/Button';

export default class Home extends Component {

  render() {
    return (
      <div>
        <Button variant="link" href="/student">Student</Button>
        <Button variant="link" href="/instructor">Instructor</Button>
      </div>
    );
  }
}
